import React from 'react'

function UserInfo() {
    const [users, setUsers] = useState([])
    useEffect(() => {
        const getUsers = async () => {
            const response = await fetch(
                'https://jsonplaceholder.typicode.com/users',
            )
            const result = await response.json()
            setUsers(result)
        }
        getUsers()
    }, [])
  return (
    <div></div>
  )
}

export default UserInfo
